import React from "react";
import { StyleSheet, Text, View, Button } from "react-native";
import {
  StackNavigationProp,
  createStackNavigator,
} from "@react-navigation/stack";
import { RootStackParamList } from "../navigator";
import { RouteProp } from "@react-navigation/native";

const Stack = createStackNavigator();

type ProfileScreenRouteProp = RouteProp<RootStackParamList, "Profile">;
type ProfileScreenNavigationProp = StackNavigationProp<
  RootStackParamList,
  "Profile"
>;

type Props = {
  navigation: ProfileScreenNavigationProp;
  route: ProfileScreenRouteProp;
};

export const Profile = () => {
  return (
    <Stack.Navigator
      initialRouteName="Home"
      screenOptions={{
        headerStyle: { backgroundColor: "#42f44b" },
        headerTintColor: "#fff",
        headerTitleStyle: { fontWeight: "bold" },
      }}
    >
      <Stack.Screen
        name="Profile"
        component={ProfileComp}
        options={{
          title: "Fandemic",
          headerStyle: {
            backgroundColor: "#f4511e",
          },
          headerTintColor: "#fff",
          headerTitleStyle: {
            fontWeight: "bold",
          },
          headerRight: () => (
            <Button
              onPress={() => alert("This is a button!")}
              title="Info"
              color="#fff"
            />
          ),
          headerLeft: () => (
            <Button
              onPress={() => alert("This is a button!")}
              title="Info"
              color="#fff"
            />
          ),
        }}
      />
      <Stack.Screen
        name="Details"
        component={DetailsComp}
        options={{ title: "Details Page" }}
      />
    </Stack.Navigator>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});

const ProfileComp = (props: Props) => {
  console.log(props);
  return (
    <View style={styles.container}>
      <Text>screen 2</Text>

      <Button
        title="Go to Jane's profile"
        onPress={() => props.navigation.navigate("Details", { name: "Jane" })}
      />
    </View>
  );
};

const DetailsComp = (props: Props) => {
  console.log(props);
  return (
    <View style={styles.container}>
      <Text>details screen 2</Text>

      <Button
        title="Go to Jane's profile"
        onPress={() => props.navigation.navigate("Profile", { name: "Jane" })}
      />
    </View>
  );
};
